import styles from '../styles/Slider.module.css';
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

export default function Slider() {
  return (
    <div className={styles.wrapper}>
    <Carousel showThumbs={false} renderIndicator = {{  position: 'absolute',
  bottom: '20px',
  left: '50%',
  transform: 'translateX(-50%)'}}>

          <span style={{ width: '100px', margin: '0 auto' }}>
          <img
          src={`${process.env.PUBLIC_URL}/public_assets/image1.png`}
          className={styles.images}
          alt='Views'
          style={{ width: '26%', margin: '15px'}}
          />
          <img
          src={`${process.env.PUBLIC_URL}/public_assets/image2.png`}
          className={styles.images}
          alt='Views'
          style={{ width: '26%',margin: '15px' }}

          />
          <img
          src={`${process.env.PUBLIC_URL}/public_assets/image2.png`}
          className={styles.images}
          alt='Views'
          style={{ width: '26%',margin: '15px' }}

          />
          </span>

          <span style={{ width: '00px', margin: '0 auto' }}>
